import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Demographic from './Demographic';

function App() {
  return (
    <Router>
      <Switch>
        <Route exact path="/">
          {/* Your home page */}
        </Route>
        <Route exact path="/demographic">
          <Demographic />
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
